import React from 'react';

class App extends React.Component {
  getNames() {
    const names = ["John", "Matt", "Sydney"];
    return names.map((name) => <span>{name}</span>);
  }

  render() {
    return (
      <div>
        <h1>This is a title</h1>
        {getNames()}
      </div>
    );
  }
}

export default App;
